import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import { Swedish } from "../componments/Swedish";

export const Routing = (props) => {
  return (
    <Router>
      {props.children}
      <Routes>
        <Route exact path="/swedish" element={<Swedish />} />
      </Routes>
    </Router>
  );
};
